import React from 'react';
import Cita from './Cita/Cita';

const citas = (props) => props.citas.map((cita, index) =>
    {
        return <Cita
        podologoName = {cita.podologoName}
        clienteName = {cita.clienteName}
        hora = {cita.horaName}
        servicio = {cita.servicio}
        estatus = {cita.estatus}
        tipo = {cita.tipo}
        atenderClick = {() => props.atenderClick(cita.id)}
        cancelarClick = {() => props.cancelarClick(cita.id)}
        observarClick = {() => props.observarClick(cita.id)} />
    });

export default citas;
